import React, { useState } from "react";
import Game from "./Game";
import styled from "styled-components";

function App() {
  const [x, setX] = useState(3);
  const [y, setY] = useState(3);

  const clickAnswer = (e) => {
    alert("정답입니다!");
    setX((prev) => prev + 1);
    setY((prev) => prev + 1);
  };

  const clickWrong = (e) => {
    alert("틀렸습니다!");
  };

  return <Game x={x} y={y} clickAnswer={clickAnswer} clickWrong={clickWrong} />;
}
export default App;
